    | None = None, onboarding_state: str | _models.OnboardingState | None = None,
    **kwargs: Any)'
  keywordOnlyParameters:
  - name: provisioning_state
    description: 'The provisioning state of the resource.


      Pending - Provisioning pending.

      Failed - Provisioning failed.

      Succeeded - Successful provisioning.

      Canceled - Provisioning canceled.

      PendingDeletion - Deletion pending.

      DeletionSuccess - Deletion successful.

      DeletionFailure - Deletion failure. Known values are: "Succeeded", "Failed",
      "Canceled",

      "Pending", "PendingDeletion", "DeletionSuccess", and "DeletionFailure".'
    types:
    - <xref:str>
    - <xref:azure.mgmt.security.v2023_09_01_preview.models.DevOpsProvisioningState>
  - name: onboarding_state
    description: 'Details about resource onboarding status across all connectors.


      OnboardedByOtherConnector - this resource has already been onboarded to another
      connector.

      This is only applicable to top-level resources.

      Onboarded - this resource has already been onboarded by the specified connector.

      NotOnboarded - this resource has not been onboarded to any connector.

      NotApplicable - the onboarding state is not applicable to the current endpoint.
      Known values

      are: "NotApplicable", "OnboardedByOtherConnector", "Onboarded", and "NotOnboarded".'
    types:
    - <xref:str>
    - <xref:azure.mgmt.security.v2023_09_01_preview.models.OnboardingState>
